<p style="margin-left: 72px; text-align: left; text-indent: -72px">　（注）１　売上高には消費税等は含まれておりません。</p>
<p style="margin-left: 72px; text-align: left; text-indent: -24px">
<span style="font-weight: normal">２　第34期の１株当たり配当額には、創立40周年記念配当40円を含んでおります。</span>
</p>
<p style="margin-left: 72px; text-align: left; text-indent: -24px">３　潜在株式調整後１株当たり当期純利益については、潜在株式が存在しないため、記載しておりません。</p>
<p style="margin-left: 72px; text-align: left; text-indent: -24px">４　自己資本利益率につきましては、期首期末平均純資産額に基づいて算出しております。</p>
<p style="margin-left: 72px; text-align: left; text-indent: -24px">５　１株当たりの各数値（配当額は除く）の計算については、発行済株式総数から自己株式数を控除して算出しております。</p>
<p style="margin-left: 72px; text-align: left; text-indent: -24px">６　第35期において、当社を存続会社とし、連結子会社である株式会社ダブルジェイスタンダードを消滅会社とする吸収合併を行いました。本合併により株式会社ダブルジェイスタンダードの普通株式１株に対して、当社の普通株式9.04株を新たに発行したため、発行済株式総数は7,230株増加しております。</p>
<p style="margin-left: 72px; text-align: left; text-indent: -24px">７　最高株価及び最低株価は東京証券取引所（市場第一部）におけるものであります。</p>
<p style="margin-left: 72px; text-align: left; text-indent: -24px">&#160;</p>
