<h3>２【沿革】</h3>
<div>
<table style="table-layout: fixed; width: 646px" cellpadding="0" cellspacing="0">
<colgroup>
<col style="width: 113px" />
<col style="width: 533px" />
</colgroup>
<tbody>
<tr>
<td style="width: 112px; border-left: 1px solid transparent; border-right: 1px solid transparent" />
<td style="border-left: 1px solid transparent; border-right: 1px solid transparent" />
</tr>
<tr style="min-height: 0px">
<td style="vertical-align: top">
<p style="margin-right: 12px; text-align: right">1985年６月</p>
</td>
<td style="vertical-align: top">
<p style="margin-left: 12px; text-align: left">靴、衣料の輸入販売を目的として、東京都新宿区早稲田に当社の前身である「株式会社国際貿易商事」を設立（資本金20百万円）。</p>
</td>
</tr>
<tr style="min-height: 0px">
<td style="vertical-align: top">
<p style="margin-right: 12px; text-align: right">1987年７月</p>
</td>
<td style="vertical-align: top">
<p style="margin-left: 12px; text-align: left">東京都荒川区三河島に本社を移転し、「株式会社インターナショナル・トレーディング・コーポレーション」に商号変更。GERRY COSBY &amp; CO.,INC社（米国）と「COSBY」の国内での商標使用権・独占販売権契約を締結。（1999年８月、契約期間満了につき終了。）</p>
</td>
</tr>
<tr style="min-height: 0px">
<td style="vertical-align: top">
<p style="margin-right: 12px; text-align: right">1990年２月</p>
</td>
<td style="vertical-align: top">
<p style="margin-left: 12px; text-align: left">靴、衣料の小売部門進出を目的として、上野地区に「ABC-MART」１号店（東京都台東区）、渋谷地区に「GALLOP」渋谷店（東京都渋谷区）など４店舗をオープン。</p>
</td>
</tr>
<tr style="min-height: 0px">
<td style="vertical-align: top">
<p style="margin-right: 12px; text-align: right">1990年８月</p>
</td>
<td style="vertical-align: top">
<p style="margin-left: 12px; text-align: left">靴小売を目的として、連結子会社「有限会社エービーシー・マート」を設立（出資金10百万円）。（1997年３月に「株式会社エービーシー・マート」に改組（資本金100百万円）。）</p>
</td>
</tr>
<tr style="min-height: 0px">
<td style="vertical-align: top">
<p style="margin-right: 12px; text-align: right">1991年１月</p>
</td>
<td style="vertical-align: top">
<p style="margin-left: 12px; text-align: left">VANS,INC.社（米国）と「VANS」の国内での独占販売権契約を締結。</p>
</td>
</tr>
<tr style="min-height: 0px">
<td style="vertical-align: top">
<p style="margin-right: 12px; text-align: right">1991年６月</p>
</td>
<td style="vertical-align: top">
<p style="margin-left: 12px; text-align: left">G.T.HAWKINS LIMITED社（英国）より「G.T.HAWKINS」のライセンス生産の権利を取得。</p>
</td>
</tr>
<tr style="min-height: 0px">
<td style="vertical-align: top">
<p style="margin-right: 12px; text-align: right">1994年６月</p>
</td>
<td style="vertical-align: top">
<p style="margin-left: 12px; text-align: left">VANS,INC.社と「VANS」の国内での商標使用権契約を締結。</p>
</td>
</tr>
<tr style="min-height: 0px">
<td style="vertical-align: top">
<p style="margin-right: 12px; text-align: right">1995年３月</p>
</td>
<td style="vertical-align: top">
<p style="margin-left: 12px; text-align: left">G.T.HAWKINS LIMITED社より「G.T.HAWKINS」の商標権を買収。</p>
</td>
</tr>
<tr style="min-height: 0px">
<td style="vertical-align: top">
<p style="margin-right: 12px; text-align: right">1998年５月</p>
</td>
<td style="vertical-align: top">
<p style="margin-left: 12px; text-align: left">東京都渋谷区神南に本社を移転。</p>
</td>
</tr>
<tr style="min-height: 0px">
<td style="vertical-align: top">
<p style="margin-right: 12px; text-align: right">2000年４月</p>
</td>
<td style="vertical-align: top">
<p style="margin-left: 12px; text-align: left">端株制度を適用している当社の株式1,000株を１単位とする単位株制度に変更するために、形式上の存続会社である連結子会社「五榮建設株式会社」と４月１日を合併期日として合併。</p>
</td>
</tr>
<tr style="min-height: 0px">
<td style="vertical-align: top">
<p style="margin-right: 12px; text-align: right">2000年10月</p>
</td>
<td style="vertical-align: top">
<p style="margin-left: 12px; text-align: left">日本証券業協会に株式を店頭登録。</p>
</td>
</tr>
<tr style="min-height: 0px">
<td style="vertical-align: top">
<p style="margin-right: 12px; text-align: right">2001年12月</p>
</td>
<td style="vertical-align: top">
<p style="margin-left: 12px; text-align: left">株式交換により、「株式会社ウインインターナショナル」（仙台市）及び「株式会社エス・ジー・シューズ・カンパニー」（福岡市）を完全子会社化。</p>
</td>
</tr>
<tr style="min-height: 0px">
<td style="vertical-align: top">
<p style="margin-right: 12px; text-align: right">2002年３月</p>
</td>
<td style="vertical-align: top">
<p style="margin-left: 12px; text-align: left">連結子会社「株式会社エービーシー・マート」を吸収合併。</p>
</td>
</tr>
<tr style="min-height: 0px">
<td style="vertical-align: top">
<p style="margin-right: 12px; text-align: right">2002年６月</p>
</td>
<td style="vertical-align: top">
<p style="margin-left: 12px; text-align: left">広告代理業務を目的として、「株式会社エービーシー・コム」を設立（出資比率100％）。</p>
</td>
</tr>
<tr style="min-height: 0px">
<td style="vertical-align: top">
<p style="margin-right: 12px; text-align: right">2002年８月</p>
</td>
<td style="vertical-align: top">
<p style="margin-left: 12px; text-align: left">「株式会社エービーシー・マート」に商号変更。</p>
</td>
</tr>
<tr style="min-height: 0px">
<td style="vertical-align: top">
<p style="margin-right: 12px; text-align: right">2002年８月</p>
</td>
<td style="vertical-align: top">
<p style="margin-left: 12px; text-align: left">韓国における靴の小売展開を目的として、「ABC-MART KOREA,INC.」を設立（出資比率51.0％）。</p>
</td>
</tr>
<tr style="min-height: 0px">
<td style="vertical-align: top">
<p style="margin-right: 12px; text-align: right">2002年11月</p>
</td>
<td style="vertical-align: top">
<p style="margin-left: 12px; text-align: left">東京証券取引所市場第一部に上場。</p>
</td>
</tr>
<tr style="min-height: 0px">
<td style="vertical-align: top">
<p style="margin-right: 12px; text-align: right">2004年３月</p>
</td>
<td style="vertical-align: top">
<p style="margin-left: 12px; text-align: left">連結子会社「株式会社エス・ジー・シューズ・カンパニー」を吸収合併。</p>
</td>
</tr>
<tr style="min-height: 0px">
<td style="vertical-align: top">
<p style="margin-right: 12px; text-align: right">2004年８月</p>
</td>
<td style="vertical-align: top">
<p style="margin-left: 12px; text-align: left">連結子会社「株式会社ウインインターナショナル」を吸収合併。</p>
</td>
</tr>
<tr style="min-height: 0px">
<td style="vertical-align: top">
<p style="margin-right: 12px; text-align: right">2009年６月</p>
</td>
<td style="vertical-align: top">
<p style="margin-left: 12px; text-align: left">「株式会社ユナイテッドアローズ」（東証１部　小売業）に資本参加し、持分法適用会社化。</p>
</td>
</tr>
<tr style="min-height: 0px">
<td style="vertical-align: top">
<p style="margin-right: 12px; text-align: right">2010年２月</p>
</td>
<td style="vertical-align: top">
<p style="margin-left: 12px; text-align: left">台湾における靴の小売展開を目的として、台湾の「JOINT POWER INTERNATIONAL Ltd.」に資本参加し、連結子会社化（出資比率55.0％）。</p>
</td>
</tr>
<tr style="min-height: 0px">
<td style="vertical-align: top">
<p style="margin-right: 12px; text-align: right">2010年８月</p>
</td>
<td style="vertical-align: top">
<p style="margin-left: 12px; text-align: left">連結子会社「JOINT POWER INTERNATIONAL Ltd.」が当社全額引受けによる株主割当増資を実施（出資比率が70.0％）。また、「JOINT POWER INTERNATIONAL Ltd.」は社名を「ABC-MART TAIWAN,INC.」に変更。</p>
</td>
</tr>
<tr style="min-height: 0px">
<td style="vertical-align: top">
<p style="margin-right: 12px; text-align: right">2010年９月</p>
</td>
<td style="vertical-align: top">
<p style="margin-left: 12px; text-align: left">持分法適用会社「株式会社ユナイテッドアローズ」が実施する自己株式の公開買付けに応じ、株式を売却。非持分法適用会社化。</p>
</td>
</tr>
<tr style="min-height: 0px">
<td style="vertical-align: top">
<p style="margin-right: 12px; text-align: right">2010年10月</p>
</td>
<td style="vertical-align: top">
<p style="margin-left: 12px; text-align: left">連結子会社「ABC-MART KOREA,INC.」が当社全額引受けによる株主割当増資を実施（出資比率68.0％）。</p>
</td>
</tr>
<tr style="min-height: 0px">
<td style="vertical-align: top">
<p style="margin-right: 12px; text-align: right">2011年３月</p>
</td>
<td style="vertical-align: top">
<p style="margin-left: 12px; text-align: left">連結子会社「ABC-MART KOREA,INC.」を完全子会社化（出資比率100.0％）。</p>
</td>
</tr>
<tr style="min-height: 36px">
<td style="vertical-align: top">
<p style="margin-right: 12px; text-align: right">2012年８月</p>
</td>
<td style="vertical-align: top">
<p style="margin-left: 12px; text-align: left">米国の靴製造販売業である「LaCrosse Footwear,Inc.」の株式を取得し、連結子会社化（出資比率100.0％）。</p>
</td>
</tr>
<tr style="min-height: 18px">
<td style="vertical-align: top">
<p style="margin-right: 12px; text-align: right">2013年３月</p>
</td>
<td style="vertical-align: top">
<p style="margin-left: 12px; text-align: left">国内初の靴製造工場「ABC SHOE FACTORY」を石川県羽咋郡に設立。</p>
</td>
</tr>
<tr style="min-height: 18px">
<td style="vertical-align: top">
<p style="margin-right: 12px; text-align: right">2019年９月</p>
</td>
<td style="vertical-align: top">
<p style="margin-left: 12px; text-align: left">
<span style="font-weight: normal">連結子会社「株式会社ダブルジェイスタンダード（出資比率90.0％）」を吸収合併。</span>
</p>
</td>
