<h3>３【事業の内容】</h3>
<p style="margin-left: 24px; text-align: left">　当社グループは、株式会社エービーシー・マート（以下、「当社」という。）を企業集団の中核とし、連結子会社９社及び非連結子会社８社から構成されております。靴を中心とした商品の販売及び自社商品の企画開発を主たる事業としております。</p>
<p style="margin-left: 24px; text-align: left">　当社は、国内において、全国各地に展開している小売店「ABC-MART」等を通じて、靴を中心に、当社ブランド「HAWKINS」「VANS」「saucony」「DANNER」「NUOVO Collection」等をはじめとした自社企画商品とナショナル・ブランド商品の販売を行い、市場のニーズやトレンドを取り入れた商品の提供をしております。また当社は、靴の企画・開発を自社で行っており、国内外の委託工場においてこれらの商品を生産し、国内市場に供給しております。良質な商品を国内のマーケットニーズに即した適正な価格で提供できる仕組みを最大限に活かし、常にお客様に支持される商品づくりを志向しております。</p>
<p style="margin-left: 24px; text-align: left">　海外におきましては、韓国で連結子会社ABC-MART KOREA,INC.が、台湾で連結子会社ABC-MART TAIWAN,INC.が「ABC-MART」を運営しております。また米国では、連結子会社LaCrosse Footwear,Inc.を筆頭にLaCrosseグループが、自社ブランドである「Danner」「White's Boots」等の靴の企画・製造・販売を行っており、米国内で小売店「DANNER」ストアを運営しております。</p>
<p style="margin-left: 24px; text-align: left">&#160;</p>
<p style="margin-left: 24px; margin-bottom: 18px; text-align: left">　事業系統図は次のとおりであります。</p>
