<p style="margin-left: 70.6699981689453px; text-align: left; text-indent: -70.6699981689453px">　　　　　　主要な損益情報等　　(1)　売上高　　　　51,532百万円</p>
<p style="margin-left: 70.6699981689453px; text-align: left; text-indent: -70.6699981689453px">　　　　　　　　　　　　　　　　(2)　経常利益　　　 3,849百万円</p>
<p style="margin-left: 70.6699981689453px; text-align: left; text-indent: -70.6699981689453px">　　　　　　　　　　　　　　　　(3)　当期純利益　　 2,967百万円</p>
<p style="margin-left: 70.6699981689453px; text-align: left; text-indent: -70.6699981689453px">　　　　　　　　　　　　　　　　(4)　純資産額　　　35,405百万円</p>
<p style="margin-left: 70.6699981689453px; text-align: left; text-indent: -70.6699981689453px">　　　　　　　　　　　　　　　　(5)　総資産額　　　39,427百万円</p>
<p style="margin-left: 70.6699981689453px; text-align: left; text-indent: -70.6699981689453px">　　　　３　当社は、当連結会計年度中において、当社を存続会社とし、連結子会社である株式会社ダブルジェイスタンダード（出資比率90％）を消滅会社とする吸収合併を行いました。これにより、連結子会社が１社減少しております。</p>
