<p style="margin-left: 24px; text-align: left">(3）労働組合の状況</p>
<p style="margin-left: 36px; text-align: left">　現在、連結子会社であるLaCrosse Footwear, Inc.において労働組合（the United Food and Commercial Workers Union）が結成されております。労使関係は良好な状態であり、特記すべき事項はありません。</p>
<p style="margin-left: 36px; text-align: left">　当社及びその他の連結子会社においては労働組合は結成されておりませんが、労使関係は良好な状況であります。</p>
